import React, { Component } from 'react';
import logo from '../img/logo.png';

export default class Logo extends Component {
  render() {
    return (
      <div className="logodiv">
        <img className="glitch top" src={logo} />
        <img className="glitch bottom" src={logo} />
      </div>
    );
  }
}
